  \"2016-11-25T21:06:30.100812\",\n\t\"name\": \"201112-national-postsecondary-student-aid-study\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The National Postsecondary Student Aid Study,
  2011-12 (NPSAS:12), is a study that is part of the National Postsecondary Student
  Aid Study (NPSAS) program. NPSAS:12 (http://nces.ed.gov/surveys/npsas/about.asp)
  is a cross-sectional survey that is designed to compile a comprehensive research
  dataset, based on student-level records, on financial aid provided by the federal
  government, the states, postsecondary institutions, employers, and private agencies,
  along with student demographic and enrollment data. The study was conducted using
  multiple sources, including institutional records, government databases, and student
  interviews. To be eligible to participate in the study,  students have to be enrolled
  in a postsecondary institution. The data are representative of all undergraduate
  and graduate students enrolled in postsecondary institutions in the 50 United States
  and the District of Columbia that were eligible to participate in the federal financial
  aid programs in Title IV of the Higher Education Act. Statistics produced from NPSAS:12
  provide reliable national estimates of characteristics related to financial aid
  for postsecondary students.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
